// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginPage from './LoginPage';
import Dashboard from './Dashboard';
import User1Profile from './User1Profile';
import User2Profile from './User2Profile';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/login" component={LoginPage} />
        <Route path="/dashboard/:user" component={Dashboard} />
        <Route path="/profile/user1" component={User1Profile} />
        <Route path="/profile/user2" component={User2Profile} />
        {/* Add more routes here if needed */}
      </Switch>
    </Router>
  );
};

export default App;
